        method: "GET",
        headers: {
          "X-CMC_PRO_API_KEY": "26b66750-b876-4f5b-860c-53ad93582a97",
          // "Content-Type": "application/json",
          // Accept: "application/json",
        },
      })
      .then((req) => {
        req.json().then((result) => {
          console.log(result);
        });
